import React from "react";

function RatingButton({rating, id}) {
  return (
    <div className="p-3">
      <div>
        <span className="title text-sm font-bold">{rating}</span>
      </div>
      <div>
        <input type="radio" value={rating} name={`q${id+1}Rating`} className="w-4 h-4 checked:bg-red-500 outline-8" />
        {/* <span className="p-3">{radioValue}</span> */}
      </div>
    </div>
  );
}

export default RatingButton;
